class MyForm extends Component{
    constructor(props){
        super(props)
    }
    render(){
        return(
            <form>
                <label>
                    Name:
                        <input type="text" name="name"></input>
                </label>
                    <input type="submit" value="enviar"></input>
            </form>
        )
    }
}
export default MyForm;
